%[text] # Cantilever Beam Optimization: Problem-Based Approach
%[text] 
%[text] This Live Script demonstrates MATLAB's **problem-based optimization** framework,
%[text] which provides a more intuitive and readable way to formulate optimization problems
%[text] compared to the traditional solver-based approach.
%[text] 
%[text:tableOfContents]{"heading":"Contents"}
%[text] 
%%
%[text] ## Problem-Based vs Solver-Based Optimization
%[text] 
%[text] MATLAB offers two approaches for optimization:
%[text] 
%[text:table]
%[text] | Aspect | Solver-Based | Problem-Based |
%[text] | --- | --- | --- |
%[text] | Formulation | Function handles | Symbolic-like expressions |
%[text] | Readability | Lower | Higher |
%[text] | Constraints | Separate functions | Direct expressions |
%[text] | Automatic conversion | No | Yes (to solver form) |
%[text] | Best for | Complex custom problems | Clear, readable formulations |
%[text:table]
%[text] 
%[text] The problem-based approach automatically selects the appropriate solver and
%[text] converts your problem to the required format.
%[text] 
%%
%[text] ## Problem Description
%[text] 
%[text] Design a cantilever beam with rectangular cross-section to **minimize material usage**
%[text] while satisfying deflection and stress constraints.
%[text] 
%[text] **Objective:**
%[text] $$\\min\_{b,h} \\quad A = b \\times h$$
%[text] 
%[text] **Subject to:**
%[text] 
%[text] $$\\delta = \\frac{4PL^3}{Ebh^3} \\leq \\delta\_{max}$$
%[text] 
%[text] $$\\sigma = \\frac{6PL}{bh^2} \\leq \\sigma\_y$$
%[text] 
%[text] $$50 \\leq b \\leq 200 \\text{ mm}, \\quad 100 \\leq h \\leq 500 \\text{ mm}$$
%[text] 
%%
%[text] ## Define Problem Parameters

L = 5;              % Beam length [m]
P = 10e3;           % Tip load [N] (10 kN)
E = 200e9;          % Young's modulus [Pa] (200 GPa)
sigma_y = 250e6;    % Yield stress [Pa] (250 MPa)
delta_max = 0.01;   % Max allowable deflection [m] (10 mm)

%[text] 
%%
%[text] ## Create Optimization Variables
%[text] 
%[text] Use `optimvar` to create optimization variables with bounds:

b = optimvar('b', 'LowerBound', 0.05, 'UpperBound', 0.20);  % Width [m]
h = optimvar('h', 'LowerBound', 0.10, 'UpperBound', 0.50);  % Height [m]

%[text] 
%[text] This is much cleaner than the solver-based approach where bounds are separate arrays.
%[text] 
%%
%[text] ## Create Optimization Problem
%[text] 
%[text] Create a minimization problem and set the objective:

prob = optimproblem('ObjectiveSense', 'minimize');
prob.Objective = b * h;

%[text] 
%[text] The objective reads naturally as "minimize b times h" - exactly matching the
%[text] mathematical formulation.
%[text] 
%%
%[text] ## Add Constraints
%[text] 
%[text] Add constraints using natural mathematical expressions:

% Deflection constraint: 4*P*L^3/(E*b*h^3) <= delta_max
% Rearranged to avoid division: 4*P*L^3 <= delta_max * E * b * h^3
prob.Constraints.deflection = 4*P*L^3 <= delta_max * E * b * h^3;

% Stress constraint: 6*P*L/(b*h^2) <= sigma_y
% Rearranged: 6*P*L <= sigma_y * b * h^2
prob.Constraints.stress = 6*P*L <= sigma_y * b * h^2;

%[text] 
%[text] **Note:** Constraints are rearranged to polynomial form (avoiding division by
%[text] optimization variables) for better numerical behavior.
%[text] 
%%
%[text] ## Review Problem Formulation
%[text] 
%[text] The `show` function displays the complete problem in readable form:

show(prob) %[output:6b80dda3]


%[text] 
%%
%[text] ## Solve the Problem
%[text] 
%[text] Provide an initial guess and solve:

x0 = struct('b', 0.125, 'h', 0.30);
[sol, fval, exitflag, output] = solve(prob, x0); %[output:9bebb2e3]


%[text] 
%[text] The solver automatically selected `fmincon` because the problem has nonlinear
%[text] constraints. No need to manually specify the solver!
%[text] 
%%
%[text] ## Analyze Results

fprintf('=== OPTIMAL DESIGN ===\n'); %[output:517502a7]
fprintf('Width b  = %.2f mm\n', sol.b * 1000); %[output:92496dbd]
fprintf('Height h = %.2f mm\n', sol.h * 1000); %[output:32f23dc1]
fprintf('Area A   = %.2f mm²\n', fval * 1e6); %[output:8a676ca2]


%[text] 
%[text] ### Verify Constraints

I_opt = sol.b * sol.h^3 / 12;
delta_opt = P * L^3 / (3 * E * I_opt);
sigma_opt = 6 * P * L / (sol.b * sol.h^2);

fprintf('\n=== CONSTRAINT CHECK ===\n'); %[output:855552b6]
fprintf('Deflection: %.4f mm <= %.1f mm\n', delta_opt*1000, delta_max*1000); %[output:2801a6e4]
fprintf('Stress:     %.2f MPa <= %.0f MPa\n', sigma_opt/1e6, sigma_y/1e6); %[output:18414f92]
fprintf('\nDeflection margin: %.1f%%n', (1 - delta_opt/delta_max)*100); %[output:6e8e2291]
fprintf('Stress margin:     %.1f%%n', (1 - sigma_opt/sigma_y)*100); %[output:6af9d5e4]


%[text] 
%%
%[text] ## Visualize the Design Space

figure('Position', [100, 100, 900, 400]); %[output:76a48c24]

% Left plot: Feasible region with constraint boundaries
subplot(1,2,1); %[output:76a48c24]
[B, H] = meshgrid(linspace(0.05, 0.20, 150), linspace(0.10, 0.50, 150));
Area = B .* H * 1e6;

% Constraint evaluation
Delta = 4*P*L^3 ./ (E * B .* H.^3);
Sigma = 6*P*L ./ (B .* H.^2);

% Feasible region
feasible = (Delta <= delta_max) & (Sigma <= sigma_y);
Area(~feasible) = NaN;

contourf(B*1000, H*1000, Area, 20); %[output:76a48c24]
colorbar; %[output:76a48c24]
hold on; %[output:76a48c24]

% Constraint boundaries
contour(B*1000, H*1000, Delta*1000, [10 10], 'r-', 'LineWidth', 2.5); %[output:76a48c24]
contour(B*1000, H*1000, Sigma/1e6, [250 250], 'm--', 'LineWidth', 2.5); %[output:76a48c24]

% Optimal point
plot(sol.b*1000, sol.h*1000, 'go', 'MarkerSize', 14, 'MarkerFaceColor', 'g', 'LineWidth', 2); %[output:76a48c24]

xlabel('Width b (mm)'); %[output:76a48c24]
ylabel('Height h (mm)'); %[output:76a48c24]
title('Design Space (Area in mm²)'); %[output:76a48c24]
legend('', 'Deflection = 10mm', '', 'Stress = 250MPa', 'Optimum', 'Location', 'northeast'); %[output:2da12cc3] %[output:76a48c24]
grid on; %[output:76a48c24]

% Right plot: Optimal cross-section
subplot(1,2,2); %[output:76a48c24]
rectangle('Position', [-sol.b/2*1000, -sol.h/2*1000, sol.b*1000, sol.h*1000], ... %[output:76a48c24]
    'FaceColor', [0.3, 0.6, 0.9], 'EdgeColor', 'k', 'LineWidth', 2); %[output:76a48c24]
axis equal; %[output:76a48c24]
xlim([-150, 150]); %[output:76a48c24]
ylim([-300, 300]); %[output:76a48c24]
xlabel('Width (mm)'); %[output:76a48c24]
ylabel('Height (mm)'); %[output:76a48c24]
title(sprintf('Optimal Cross-Section\nb = %.1f mm, h = %.1f mm', sol.b*1000, sol.h*1000)); %[output:76a48c24]
grid on; %[output:76a48c24]

sgtitle('Cantilever Beam Optimization Results', 'FontWeight', 'bold'); %[output:76a48c24]


%[text] 
%%
%[text] ## Key Advantages of Problem-Based Approach
%[text] 
%[text] 
%[text] 
%[text] 
%[text] 
%[text] 
%[text] ### Code Comparison
%[text] 
%[text] **Solver-based** (traditional):
%[text] ```matlabCodeExample
%[text] objective = @(x) x(1) * x(2);
%[text] nonlcon = @(x) deal([...constraints...], []);
%[text] [x, fval] = fmincon(objective, x0, [], [], [], [], lb, ub, nonlcon);
%[text] ```
%[text] 
%[text] **Problem-based** (modern):
%[text] ```matlabCodeExample
%[text] prob.Objective = b * h;
%[text] prob.Constraints.deflection = 4*P*L^3 <= delta_max * E * b * h^3;
%[text] [sol, fval] = solve(prob, x0);
%[text] ```
%[text] 
%%
%[text] ## Conclusion
%[text] 
%[text] The problem-based approach produces the same optimal solution:
%[text] 
%[text] 
%[text] The deflection constraint is **active** (binding), while stress has 82% margin.
%[text] This confirms that stiffness, not strength, drives this design.

